@Quỳnh Nhai
- Mỏ than ở huyện Quỳnh Nhai, tỉnh Sơn La được phát hiện vào đầu thế kỷ 20. Khai thác dùng phương pháp hầm lò
- (huyện) Huyện ở phía tây bắc tỉnh Sơn La. Diện tích 796km2. Số dân 325.000 (1997), gồm các dân tộc: Thái, Mường, Dao, Tày, Kinh. Địa hình phần lớn là núi thấp đỉnh Khao Pum (1823m), ở phía tây có các mỏ than Quỳnh Nhai. Đường liên tỉnh Sơn La-Lai Châu chạy qua huyện. Trước đây đã là châu Quỳnh Nhai, phủ An Tây, trấn Hưng Hoá, đuợc đổi thành huyện gồm 7 xã

@Quỳnh Côi
- (huyện) Huyện thuộc tỉnh Thái Bình, từ 17-6-1969, hợp nhất với huyện Phụ Dực thành huyện Quỳnh Phụ (x. Quỳnh Phụ)
- (thị trấn) h. Quỳnh Phụ, t. Thái Bình

@Quỳ Hợp
- (huyện) Huyện ở phía tây bắc tỉnh Nghệ An. Diện tích 988km2. Số dân 110.500 (1997), gồm các dân tộc: Kinh, Thổ. Địa hình đồi núi thấp xen các thung lũng đất bazan, các đỉnh Bù Khang (1058m), Phu Lang (654m). Sông Hiếu chảy qua. Khoáng sản: thiếc, hồng ngọc. Đường 532 chạy qua. Huyện thuộc tỉnh Nghệ An từ xưa, thuộc tỉnh Nghệ Tĩnh (1975-91), từ 20-7-1991, trở lại tỉnh Nghệ An, gồm 1 thị trấn (Quỳ Hợp) huyện lị, 20 xã
- (xã) h. Quỳ Hợp, t. Nghệ An

